  \"Mingo National Wildlife Refuge Annual narrative report: Calendar year 1983\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 2,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2015-02-05T02:08:37.720795\",\n\t\"name\": \"mingo-national-wildlife-refuge-annual-narrative-report-calendar-year-1983\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Mingo
  National Wildlife Refuge outlines Refuge accomplishments during the 1983 calendar
  year. The report begins with an introduction to the Refuge, climate and habitat
  conditions, and land acquisition. The planning section discusses the master plan,
  management plan, public participation, compliance with environmental mandates, and
  research and investigations. Administration topics are covered, including: personnel,
  youth programs, volunteer programs, funding, safety, and technical assistance. Habitat
  management is covered; croplands, grasslands, wetlands, forestlands, grazing, haying,
  fire management, pest control, and wilderness and special areas are discussed. The
  wildlife section of the report discusses wildlife diversity, endangered and threatened
  species, migratory birds, raptors, game mammals, fisheries resources, wildlife propagation
  and stocking, scientific collections, animal control, and marking and banding. Interpretation
  and recreation activities are outlined; topics include information and interpretation,
  recreational uses, and law enforcement. The equipment and facilities section discusses
  new construction, rehabilitation, major maintenance, and equipment replacement.
  Cooperative programs and items of interest are discussed. Photographs and brochures
  are attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
